export const prices = [
  {
    _id: 0,
    name: "Any",
    array: [],
  },
  {
    _id: 1,
    name: "Rs. 10 to Rs.100",
    array: [10, 100],
  },
  {
    _id: 2,
    name: "Rs.100 to Rs.500",
    array: [100, 500],
  },
  {
    _id: 3,
    name: "Rs.500 and above",
    array: [500, 100000],
  },
];
